const HomeScreen = ({ match }) => {
  const keyword = match.params.keyword;
  const pageNumber = match.params.pageNumber || 1;

  const dispatch = useDispatch();

  const productList = useSelector((state) => state.productList);
  const { loading, error, products, page, pages } = productList;

  useEffect(() => {
    dispatch(listProducts(keyword, pageNumber));
  }, [dispatch, keyword, pageNumber]);

  return (
    <>
      <Meta />

      {!keyword && <ProductCarousel />}

      {/* Left and Right Banners */}
      <div className="side-banner left-banner">
        <img
          src="/images/banner/side-banner1.jpg"
          alt="Left Banner"
        />
      </div>
      <div className="side-banner right-banner">
        <img
          src="/images/banner/side-banner2.jpg"
          alt="Right Banner"
        />
      </div>

      {/* Main Content */}
      <FeatureSection />

      <Container className="py-4">
        <Row className="justify-content-center">
          {['/images/banner/img2-middle-sinrato1.jpg', '/images/banner/img1-middle-sinrato1.jpg'].map((img, index) => (
            <Col key={index} md={6} className="text-center">
              <img
                src={img}
                alt={`Top Banner ${index + 1}`}
                style={{
                  width: '100%',
                  height: 'auto',
                  borderRadius: '10px',
                }}
              />
            </Col>
          ))}
        </Row>
      </Container>

      <Container className="py-5">
        <SectionTitle>Sản Phẩm Bán Chạy</SectionTitle>
        {loading ? (
          <Loader />
        ) : error ? (
          <Message variant="danger">{error}</Message>
        ) : products && products.length > 0 ? (
          <Row>
            {products.slice(0, 4).map((product) => (
              <Col key={product._id} sm={12} md={6} lg={3}>
                <Product product={product} />
              </Col>
            ))}
          </Row>
        ) : (
          <Message variant="info">Không có sản phẩm nào</Message>
        )}
      </Container>

      <Banner position="middle" />

      <Container className="py-5">
        <SectionTitle>Tất Cả Sản Phẩm</SectionTitle>
        {loading ? (
          <Loader />
        ) : error ? (
          <Message variant="danger">{error}</Message>
        ) : products && products.length > 0 ? (
          <>
            <Row>
              {products.map((product) => (
                <Col key={product._id} sm={12} md={6} lg={4} xl={3}>
                  <Product product={product} />
                </Col>
              ))}
            </Row>
            <Paginate pages={pages} page={page} keyword={keyword || ''} />
          </>
        ) : (
          <Message variant="info">Không tìm thấy sản phẩm</Message>
        )}
      </Container>

      <div className="footer-banner">
        <img
          src="/images/banner/img-bottom-sinrato1.jpg"
          alt="Footer Banner"
          style={{
            width: '100%',
            height: 'auto',
            borderRadius: '10px',
            marginBottom: '20px',
          }}
        />
      </div>
    </>
  );
};

export default HomeScreen;
